import './app.scss';
import { Navbar } from './components/Nav/Navbar';
import { Slider } from './components/Slider/Slider';
import {ReactComponent as LogoIcon} from './assets/icon/logo.svg';



export const App = () => {
  return (
    <div className="wrapper">
      <div className='logo__wrap'> 
        <LogoIcon width={'38'}/>
      </div>
<Navbar/>
      <Slider/>
    </div>
  )
}
 export default App;
